import React from "react";
import Character from "./Cards/Cards";

export default function Container(props) {
  return (
      <div>
           {filteredChars.map((character) => {
        return (
          <Character
            key={character.id}
            img={character.image}
            name={character.name}
            origin={character.origin.name}
            status={character.status}
            gender={character.gender}
          />
        );
      })}

    </div>
  );
}
